(function(window){var Monome=function(template){var monome=this;var panel=Object.create(UI_Panel,{name:{value:"monome"}});console.log(panel);panel.render();monome.set=function(row,min,max,vel){bus.send(["mono","set","skeleton","log",[row,min,max,vel]])}};window.mono=Monome})(window);(function(window){var Skeleton=function(template){console.log(template);var skel=this;skel.template=template;skel.init=function(){var panel=Object.create(UI_Panel,{name:{value:"skel"}});panel.render()};skel.interpret=function(cmd){bus.send(["iron","interpret","Waffle","loadModule",cmd])}};window.skeleton=Skeleton})(window);var UI_Panel={name:"untitled",template:'<div class="panel"></div>',render:function(){var container=document.createElement("div"),offset_x=0,offset_y=0;container.setAttribute("id",this.name);container.innerHTML=this.template;document.body.appendChild(container);var panel=container.querySelector(".panel");panel.ondragstart=function(e){offset_x=e.clientX-panel.offsetLeft;offset_y=e.clientY-panel.offsetTop};panel.ondrag=function(e){panel.style.left=e.clientX-offset_x+"px";panel.style.top=e.clientY-offset_y+"px"};panel.ondragend=function(e){e.preventDefault()}}};var UI_textInput={template:"",output:function(command){console.log(command)},render:function(){var input=document.getElementById("cmd");cmd.onsubmit=function(e){e.preventDefault();var input=document.getElementById("prompt"),prompt=e.target.prompt.value;input.value="";input.blur();this.output(prompt)}}};var UI_NumberBox={name:"untitled",markup:"",render:function(){var num=box.querySelector(".number");num.onmousewheel=function(event){var oldVal=parseInt(this.innerHTML),value=event.wheelDeltaY,newVal=null;if(value<0){newVal=oldVal+Math.abs(value)}else{newVal=oldVal-Math.abs(value)}}},ready:function(){}};